    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1942. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts, and wildfires. Resource
    management is outlined; topics include grazing, fur harvesting, and timber removal.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and violations. N-R forms are attached.",nt"owner_org":
